import React from "react"
import "./footer.scss"

const Footer = () => {
  const data = [1, 2, 3, 4, 5, 6, 7, 8, 9]
  const numchanger = data => {
    let index = 0
    for (let i = 0; i++; i <= data.length) {
      index = i
    }
    return index
  }

  setInterval(function() {
    let i = 0
    return i++
  }, 3000)

  return (
    <div className="footer">
      <div className="footer-dot">
        <h1>FUDO</h1>
      </div>
    </div>
  )
}
export default Footer
